// src/components/HomePage.jsx
import React, { useState, useEffect } from "react";
import axios from "axios";
import SearchEngine from "./SearchEngine";
import Forecast from "./Forecast";
import {
  Container,
  Typography,
  CircularProgress,
  Box,
  Card,
  CardContent,
  TextField,
  Button,
} from "@mui/material";
import "../styles.css";
import "@fortawesome/fontawesome-free/css/all.min.css";

function HomePage() {
  const [weather, setWeather] = useState({
    loading: true,
    data: {},
    error: false,
  });
  const [inputs, setInputs] = useState({
    minTemp: 0,
    maxTemp: 0,
    humidity9am: 0,
    humidity3pm: 0,
    windSpeed9am: 0,
    windSpeed3pm: 0,
  });

  const handleInputChange = (event) => {
    const { name, value } = event.target;
    setInputs((prevInputs) => ({
      ...prevInputs,
      [name]: value,
    }));
  };

  const fetchPrediction = async () => {
    setWeather({ ...weather, loading: true });
    const { minTemp, maxTemp, humidity9am, humidity3pm, windSpeed9am, windSpeed3pm } = inputs;
    const url = `http://localhost:8000/predict/weather/${minTemp}/${maxTemp}/${humidity9am}/${humidity3pm}/${windSpeed9am}/${windSpeed3pm}`;

    try {
      const response = await axios.get(url);
      setWeather({ data: response.data, loading: false, error: false });
    } catch (error) {
      setWeather({ ...weather, data: {}, error: true });
    }
  };

  return (
    <Container
      className="App"
      maxWidth="md"
      style={{
        padding: "20px",
        borderRadius: "10px",
        backgroundColor: "transparent",
      }}
    >
      <Typography
        variant="h4"
        align="center"
        gutterBottom
        style={{ color: "#00796b", fontWeight: "bold" }}
      >
        Weather Forecast
      </Typography>

      <Box display="flex" justifyContent="center" flexDirection="column" alignItems="center">
        <TextField
          name="minTemp"
          label="Min Temperature"
          type="number"
          variant="outlined"
          onChange={handleInputChange}
          style={{ margin: "5px" }}
        />
        <TextField
          name="maxTemp"
          label="Max Temperature"
          type="number"
          variant="outlined"
          onChange={handleInputChange}
          style={{ margin: "5px" }}
        />
        <TextField
          name="humidity9am"
          label="Humidity 9 AM"
          type="number"
          variant="outlined"
          onChange={handleInputChange}
          style={{ margin: "5px" }}
        />
        <TextField
          name="humidity3pm"
          label="Humidity 3 PM"
          type="number"
          variant="outlined"
          onChange={handleInputChange}
          style={{ margin: "5px" }}
        />
        <TextField
          name="windSpeed9am"
          label="Wind Speed 9 AM"
          type="number"
          variant="outlined"
          onChange={handleInputChange}
          style={{ margin: "5px" }}
        />
        <TextField
          name="windSpeed3pm"
          label="Wind Speed 3 PM"
          type="number"
          variant="outlined"
          onChange={handleInputChange}
          style={{ margin: "5px" }}
        />
        <Button variant="contained" color="primary" onClick={fetchPrediction} style={{ marginTop: "10px" }}>
          Get Weather Prediction
        </Button>
      </Box>

      <Box display="flex" justifyContent="center" flexWrap="wrap" mt={4}>
        <Card className="card">
          <CardContent>
            {weather.loading ? (
              <Box display="flex" justifyContent="center">
                <CircularProgress color="primary" />
              </Box>
            ) : weather.error ? (
              <Typography variant="h6" color="error" align="center">
                Sorry, an error occurred while fetching the prediction. Please try again.
              </Typography>
            ) : (
              <Forecast weather={weather} />
            )}
          </CardContent>
        </Card>
      </Box>
    </Container>
  );
}

export default HomePage;
